description:
American boy, Cody, whose parents have died, lives in Australia with his guardian, Gaza. Cody is very imaginative, inventive, and inquisitive. He comes across some strange events happening in Devil's Knob national park associated with an aboriginal myth about &quot;frog dreamings&quot;. Cody tries to investigate...

